    def parse(self, response):
        if response.status == 200:
            tables = response.xpath('//table')
            if len(tables) > 3:
                item = CricosItem()
                course_table = response.xpath('//table')[1]
                bigdata = ""
                for row in course_table.xpath('.//tr'):
                    colname = str(row.xpath('td[@class="clsFormLabelLeft"]/text()').extract())
                    coldata = str(row.xpath('td/span/text()').extract()) + " "
                    bigdata = bigdata + colname + coldata
                item['cdata'] = bigdata
                item['caid'] = response.url.split("=")[1] # split url take last string which is the course id

                uni_table = response.xpath('.//table')[3]
                bigdata = ""
                for row in uni_table.xpath('.//tr'):
                    unicol = str(row.xpath('td[@class="clsFormLabelLeft"]/text()').extract())
                    unidata1 = str(row.xpath('td/a/text()').extract())
                    unidata2 = str(row.xpath('td/span/text()').extract()) + " "
                    bigdata = bigdata + unicol + unidata1 + unidata2
                item['unidata'] = bigdata 

                yield item